    constexpr std::array<Scalar, 100> input_shift = {5.263862035e-05, 2.090289870e-04, 2.978712579e-05, 2.326341919e-04, 7.713703828e-05, 6.017113240e-05, 3.853201631e-05, 5.034017639e-06, 1.036938218e-05, 2.906424751e-04, 3.653413299e-05, 8.485745473e-05, 1.667361968e-05, 2.658245507e-04, 6.008564547e-05, 1.607070524e-04, 1.592436662e-05, 1.439004851e-04, 6.311748904e-05, 1.078690508e-05, 7.494100689e-05, 7.943861523e-05, 5.876603424e-06, 2.389913229e-05, 3.250432995e-04, 3.007768713e-07, 8.158590508e-05, 2.297103811e-05, 1.361694806e-05, 4.355439171e-05, 4.646773953e-05, 1.647555576e-04, 2.015799766e-04, 2.238399325e-04, 9.688804054e-05, 6.396406293e-05, 1.635647734e-05, 3.956262101e-05, 9.931704108e-05, 2.807426328e-05, 1.048469766e-04, 1.216446258e-04, 1.850695643e-04, 1.593859624e-04, 1.304446537e-04, 2.153821779e-05, 5.293170075e-05, 2.050179757e-04, 2.830595871e-04, 1.514460140e-04, 6.727048091e-05, 7.447982148e-05, 5.353298431e-05, 3.259493752e-04, 4.855570340e-05, 1.208080092e-05, 1.074675717e-04, 2.513040632e-05, 6.493148702e-05, 5.288123264e-05, 7.821277377e-06, 8.421227162e-06, 1.670146179e-04, 4.712918441e-05, 5.493305887e-05, 5.159872899e-06, 2.025603453e-05, 3.207464788e-05, 6.759857301e-04, 5.746264492e-05, 1.413302084e-04, 1.235796394e-05, 7.552760311e-06, 3.799386558e-05, 2.729641596e-05, 1.652970222e-04, 1.494400231e-05, 2.781696314e-05, 1.893703028e-04, 2.972982035e-05, 8.363570465e-05, 3.720404858e-05, 1.417524142e-04, 8.187341986e-05, 2.945763484e-04, 3.934503106e-04, 1.342699121e-04, 2.414780931e-04, 2.081800481e-04, 3.924832997e-05, 2.460690946e-04, 1.288920374e-04, 1.429816730e-05, 1.670647588e-04, 6.151143815e-06, 2.403698384e-05, 1.079363369e-04, 1.009835771e-04, 6.578540301e-05, 5.920718017e-06};

    constexpr std::array<Scalar, 10> output_scale = {9.998625672e-01, 9.998994714e-01, 9.998986323e-01, 9.998592383e-01, 9.996952607e-01, 9.999809883e-01, 9.998013747e-01, 9.995849888e-01, 9.999050835e-01, 9.998254081e-01};

    constexpr std::array<Scalar, 10> output_shift = {1.894577873e-05, 9.356226289e-05, 9.694885763e-05, 9.849271353e-05, 6.221580006e-06, 1.312947822e-05, 8.603067037e-05, 8.828702142e-05, 9.126865768e-05, 4.726821678e-05};


//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\// 


    auto sigmoid = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        output = 1 / (1 + std::exp(-input));
    };

    auto mish = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        Scalar softplus;
        if (input > Scalar(20))          
            softplus = input;
        else if (input < Scalar(-20))    
            softplus = std::exp(input);
        else
            softplus = std::log1p(std::exp(input));
        output = input * std::tanh(softplus);
    };

    auto relu = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        output = input > 0 ? input : 0;
    };

    static constexpr Scalar kC0 = 0.044715;
    static constexpr Scalar kSqrt2PiInv = Scalar(0.7978845608028654);
    auto gelu = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        Scalar x3 = input * input * input;
        Scalar y  = kSqrt2PiInv * (input + kC0 * x3);
        output     = Scalar(0.5) * input * (Scalar(1) + std::tanh(y));
    };

    auto silu = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        auto sigmoid = 1 / (1 + std::exp(-input));
        output = input * sigmoid;
    };

    auto linear = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        output = input;
    };

    auto tanhCustom = +[](Scalar& output, Scalar input, Scalar alpha) noexcept 
    {
        output = std::tanh(input);
    };

    auto softmax = +[](Scalar* __restrict outputs, const Scalar* __restrict inputs, int size) noexcept
    {
        const Scalar max_val = *std::max_element(inputs, inputs + size);
        Scalar sum = 0;
        for (int i = 0; i < size; ++i) {
            const Scalar e = std::exp(inputs[i] - max_val);
            outputs[i] = e;
            sum += e;
        }
        for (int i = 0; i < size; ++i) {
            outputs[i] /= sum;
        }
    };


//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\// 

    
    // model input and flattened
